import React from "react";
import Layout from "../components/layout";

const Notifications = () => {
  return (
    <React.Fragment>
      <Layout>
        <div className="h-screen">
          <h1>Notifications Page</h1>
        </div>
      </Layout>
    </React.Fragment>
  );
};

export default Notifications;
